import logo from './logo.svg';
import './App.css';

//importamos los componentes
import ShowCountries from './country/ShowCountries';
import CreateCountry from './country/CreateCountry';
import EditCountry from './country/EditCountry';

//importamos el router
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
            <Route path='/' element={ <ShowCountries />} />
            <Route path='/create' element={ <CreateCountry />} />
            <Route path='/edit/:id' element={ <EditCountry />} />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
